INSERT INTO public.submission VALUES ('c1490cb9-93c4-4730-9a1b-bf20f44b35d8', '', 0, false, '', 'Trong thời gian hoạt động tại Đoàn khối OISP em vinh dự được nằm trong ban tổ chức, Xuân tình nguyện 2021. Người tham gia mùa hè xanh online 2021 do Đoàn khối Văn phòng đào tạo Quốc tế tổ chức. Tên file OISP-1, OISP-2.', '', '2021-12-16 09:04:30.221061', '2021-12-16 09:14:37.693389', '2021-12-16 09:04:30.221061', '2021-12-16 09:04:30.221061', 146, 6, '456e2adb-d1ba-486a-bbf9-0aa9e79da483');
INSERT INTO public.submission VALUES ('aa78b064-8d4d-4584-9af2-f22983bf972c', '7f335172-5adb-460f-a7ec-25b0107ec560.png', 0, false, '', 'Qua sự kiện làm cộng tác viên OIF 2020 em cảm thấy sự kiện này rất bổ ích khi được giao lưu văn hóa giữa các nước trên thế giới. OIF sân chơi văn hóa cần được mở rộng ra cho nhiều sinh viên trường Bách Khoa cũng như các trường bạn ở thành phố Hồ Chí Minh hơn. Tên file: OISP-4', '', '2021-12-16 09:04:30.221946', '2021-12-16 09:14:37.699627', '2021-12-16 09:04:30.221946', '2021-12-16 09:04:30.221946', 146, 6, '7f335172-5adb-460f-a7ec-25b0107ec560');
